import React from "react";
import { Link } from "react-router-dom";
import "./NavBar.css";

function HomeNav() {
    return (
      <header className="NavBar">
        <button><Link to="https://thisguycodez.github.io/buildweekTEST/index.html">Home</Link></button>
      </header>
    );
}

export default HomeNav;
